import React, {Component} from 'react';
import ReactDom from 'react-dom';

class TotalSummary extends Component {
  constructor (props) {
    super(props)
  }
  render () {
    return (
      <div>
        <header>
          <span>Balance</span>
        </header>
      </div>
    )
  }
}

export default TotalSummary;
